import React from 'react'
import { Button } from "react-native";

const HomeScreen = ({navigation, route: {params : props}})=> {
    return (
    <Button
        title="prueba"
        onPress={()=> navigation.navigate(
            'Profile', 
            { name: 'Jane', }
        )}
    />
)}

export default HomeScreen
